import { useState, useEffect, Component } from "react";
import axios from "axios";
import "./PrivateScreen.css";
import React from 'react';
import { Link } from "react-router-dom";

const StudentScreen = () => {

  const [error, setError] = useState("");
  const [faculty, setFaculty] = useState([]);
  const [success, setSuccess] = useState(false);

  useEffect(() => {
    const fetchPrivateDate = async () => {
      const config = {
        headers: {
          "Content-Type": "application/json",
          token: localStorage.getItem("authToken"),
        },
      };

      try {
        const {data}  = await axios.get("/homeStudent/lstFaculty", config);
        setFaculty(data.data);
        setSuccess(data.data.success);
        //console.log(privateData);

      } catch (error) {
        // localStorage.removeItem("authToken");
        setError("You are not authorized please login");
      }
    };

    fetchPrivateDate();
  }, []);

  const changeLink = (check) => {
    success ? <Link to={`//${check}`} color="warning" className="btn btn-warning mr-1">View</Link> 
    : <Link to={`//${check}`} color="warning" className="btn btn-warning mr-1">Join</Link>
  }

  const display = faculty.map((item,index) => 
    <tr key={index}>
      <td>{item.facultyName}</td>
      <td>{item.coordinator.name}</td>
      <td>{item.startDay}</td>
      <td>{item.endDay}</td>
      <td>{changeLink(item._id)}</td>
      <td><button>Delete</button></td>

    </tr>  
  )

  return error ? (
    <span className="error-message">{error}</span>
  ) : (
    <table className="content-table">
      <thead>
        <tr>
          <th>Faculty Title</th>
          <th>Coordinator Name</th>
          <th>Start Date</th>
          <th>End Date</th>
          <th colSpan="2">Action</th>
        </tr>
      </thead>
      <tbody>
        {display}
      </tbody>
    </table>
  );
};

export default StudentScreen;
